// Function to generate figmaCode dynamically
const generateFigmaCode = (data) => {
  return `
    ${data.figmacom}
  `;
};

const copyFigmaToClipboard = (figmaCode) => {
  const htmlData = `
    <html>
      <head>
        <meta http-equiv="content-type" content="text/html; charset=utf-8">
      </head>
      <body>
        <!--StartFragment-->
        ${figmaCode} <!-- Dynamic Figma component data goes here -->
        <!--EndFragment-->
      </body>
    </html>
  `;

  const blob = new Blob([htmlData], { type: "text/html" });
  const item = new ClipboardItem({ "text/html": blob });

  navigator.clipboard
    .write([item])
    .then(() => {
      console.log("Figma component copied to clipboard!");
      alert("Figma component copied to clipboard!");
    })
    .catch((err) => {
      console.error("Failed to copy:", err);
      alert("Failed to copy Figma component.");
    });
};

